import { useContext, useEffect } from "react";
import { Routes, Route, Link } from "react-router-dom";
import { ThemeContext } from "./contexts/theme";
import Header from "./components/Header/Header";
import ScrollToTop from "./components/ScrollToTop/ScrollToTop";
import Footer from "./components/Footer/Footer";
import Autobidder from "./components/Autobidder/Autobidder";
import FreeTimeFinder from "./components/FreeTimeFinder/FreeTimeFinder";
import Instagram from "./components/Instagram/Instagram";
import Home from "./components/Home/Home";
import "./App.css";
import Sidebar from "./components/sidebar/Sidebar";
import { Outlet } from "react-router-dom";

const App = () => {
  const [{ themeName }] = useContext(ThemeContext);

  return (
    <div>
      {" "}
      <Sidebar />
      <Outlet />
      <div
        id="top"
        style={{
          padding: "50px 50px 10px 370px",
        }}
        className={`${themeName} app`}
      >
        {/* <Header /> */}
        <Sidebar />
        <Outlet />

        <Routes>
          <Route path="/" element={<AppLayout />} />
          <Route index element={<HomePage />} />

          {/* <Route path="/test" element={<Home />} />
        <Route path="/instagram" element={<Instagram />} />
        <Route path="/fifa-autobidder" element={<Autobidder />} />
        <Route path="/free-time-finder-v2" element={<FreeTimeFinder />} /> */}
        </Routes>

        <ScrollToTop />
        <Footer />
      </div>
    </div>
  );
};

export default App;

import About from "./components/About/About";
import Projects from "./components/Projects/Projects";
import Skills from "./components/Skills/Skills";
import Contact from "./components/Contact/Contact";
import AppLayout from "./components/layout/AppLayout";

function HomePage() {
  return (
    <>
      <main>
        <About />
        <Projects />
        <Skills />
        <Contact />
      </main>
    </>
  );
}
